import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";
import { Main } from "./pages/index";
function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/" component={Main} exact={true} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
